import React from "react";
import styled from "styled-components";

export default function Header(props) {
  return (
    <Nav>
      <Logo>
        <img src="/images/logo.svg" />
      </Logo>
      <NavMenu>
        <a href="/home">
          <img src="public/images/home-icon.svg" alt="" />
        </a>
        <span>Home</span>
      </NavMenu>
    </Nav>
  );
}

const Nav = styled.nav`
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  height: 70px;
  background-color: #090b13;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  padding: 0 36px;
  letter-spacing: 10px;
  z-index: 3;
`;

const Logo = styled.a`
  margin-top: 2px;
  padding: 0px;
  width: 80px;
  max-height: 70px;
  display: inline-block;

  img {
    display: block;
    width: 100%;
  }
`;

const NavMenu = styled.div`
  align-items: center;
  display: flex;
  flex-flow: row nowrap;
  height: 100%;
  justify-content: flex-end;
  margin: 0;
  padding: 0;
  position: relative;
  margin-right: auto;
  margin-left: 25px;

  a {
    padding: 0 12px;
    display: flex;
    align-items: center;

    img {
      height: 20px;
    }
  }

  @media (max-width: 760px) {
    display: none;
  } ;
`;
